import React, {useState} from 'react';

const Subirlikes = () => {
    const [count, setCount] = useState(0)

    const subircuenta =()=>{
        setCount(prevCount => prevCount+1)
    }

    return (
        <div>
            <div className = "botones">
                <span>{count}</span>
                <button onClick={subircuenta}>Subir Likes</button>
            </div>
        </div>
    );
}

export default Subirlikes;
